import React, { Component } from "react";
import TeamScore from "./components/TeamScore.js";
import TugOfWar from "./components/TugOfWar.js";
import "./App.scss";

class App extends Component {
  state = {
    humans: {
      count: 123,
      earned: 0.123456
    },
    zombies: {
      count: 123,
      earned: 0.789012
    }
  };

  render() {
    return (
      <div>
        <div>You are a human</div>
        <div>
          <TeamScore
            name="humans"
            count={this.state.humans.count}
            earned={this.state.humans.earned}
          />
          <TeamScore
            name="zombies"
            count={this.state.zombies.count}
            earned={this.state.zombies.earned}
          />
        </div>
        <TugOfWar
          zombies={this.state.zombies.count}
          humans={this.state.humans.count}
        />
      </div>
    );
  }
}

export default App;
